import React from 'react';

const style = `
.header {
  height: 50vh;
  width: 100%;
  background: url(https://media.giphy.com/media/ZcdJJvDqTgdGZK8Xd3/giphy.gif) repeat center;
  background-size: cover;

}
`;

const Header = () => {
  return (
    <div className="header">
      <style>{style}</style>
      <h1>Mark Vincent Go</h1>
    </div>
  );
};

export default Header;
